@implementation ViewController

- (void)viewDidLoad
{
    [super viewDidLoad];
	// Do any additional setup after loading the view, typically from a nib.
    [self setTitle:@"Pumabus Menu"];
    
    UIBarButtonItem *addButton = [[UIBarButtonItem alloc] initWithTitle:@"Rutas" style:UIBarButtonItemStylePlain target:self action:@selector(saludo:)];
                                  self.navigationItem.rightBarButtonItem = addButton;
    
    UIBarButtonItem *mapa=[[UIBarButtonItem alloc] initWithTitle:@"Mapa" style:UIBarButtonItemStylePlain target:self action:@selector(MostrarMap:)];
    self.navigationItem.leftBarButtonItem= mapa;
    
    
    //Pull the content from the file into memory
    NSString *myListPath = [[NSBundle mainBundle] pathForResource:@"Rutas" ofType:@"plist"];
    tableData = [[NSMutableArray alloc]initWithContentsOfFile:myListPath];
    
	NSString *filePath = [[NSBundle mainBundle] pathForResource:@"estacionesdef.txt" ofType:nil];
	NSData* data = [NSData dataWithContentsOfFile:filePath];
    
	//Convert the bytes from the file into a string
	NSString* string = [[NSString alloc] initWithBytes:[data bytes]
                                                length:[data length]
                                              encoding:NSUTF8StringEncoding ];
	
	//Split the string around newline characters to create an array
	NSString* delimiter = @"\n";
	NSArray *item = [string componentsSeparatedByString:delimiter];
	elementArray = [[NSMutableArray alloc] initWithArray:item];
	autoCompleteArray = [[NSMutableArray alloc] init];
    
    //Autocomplete Table
	autoCompleteTableView = [[UITableView alloc] initWithFrame:CGRectMake(0, 70, 320, 60) style:UITableViewStylePlain];
    autoCompleteTableView.delegate = self;
    autoCompleteTableView.dataSource = self;
    autoCompleteTableView.scrollEnabled = YES;
    autoCompleteTableView.hidden = YES;
    
    [self.view addSubview:autoCompleteTableView];
    
    
}

-(IBAction)saludo:(id)sender
{
    ListaRutas *rutaslist=[[ListaRutas alloc] initWithNibName:@"ListaRutas" bundle:nil];
